import React from 'react'
import { Dialog } from '@mui/material'

const dialogStyle = {
    height : '90%',
    width : '80%',
    maxWidth: ''
}
const ComposeMail= () => {
  return (
    <Dialog
    open ={true}
    PaperProps={ {sx: dialogStyle}}
    >
      Hello from Dialog
    </Dialog>
  )
}

export default ComposeMail
